import Navbar from "../components/Navbar";

function Dashboard() {
  return (
    <div>
      <Navbar />
      <div style={{ padding: 20 }}>
        <h1>Dashboard</h1>
        <p>Bienvenido al sistema de vacunación. Usa el menú para navegar.</p>
      </div>
    </div>
  );
}

export default Dashboard;
